import React from "react";
import "./App.css";
import Main from "./components/Main/Main";
import Sidebar from "./components/Sidebar/Sidebar";
import { Back } from "./AppElements";
import { backData } from "./data/data";

function App() {
  return (
    <div className="App">
      <Back style={backData} />
      <Sidebar />
      <Main />
    </div>
  );
}

export default App;
